import React from "react"
import Card from "./aboutcomp"
import {data} from "./values1"

function About(){
    return(

            <div>
                <a href="./Home.js">Back to home page</a>
            <h1>About Our Company:</h1>
            {
            data.map((item)=>{
                return(
                <Card {...item}></Card>
                )
            })
            }
            </div>
                )
}

export default About
